import React, { Component } from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";
import Container from 'react-bootstrap/Container'

import StudentNavbar from "../student/student-navbar.component";
import SubmitAnswer from "./student-submit-answer.component";
import StudentHome from "./studentapp-home.component"

export default class StudentApp extends Component {
  constructor(props) {
    super(props);
  }

  render () {
    return (
      <div>
      <Router>
        <Container>
        <StudentNavbar />
            <br />
              <Route path="/studentapp/submit" component = {SubmitAnswer} />
              <Route path="/studentapp/home" component = {StudentHome} />
              <Route path="/studentapp/courses" component = {StudentCourses} />
        </Container>
      </Router>
    </div>      
    );
  }
}
